The Save&Drive OMV  application is designed for all new and existing members of the Save&Drive  program who would like to keep up-to-date with all latest program features and to have their virtual card in the phone.
The application offers:
- Save&Drive VIRTUAL CARD for easy identification, replacing the plastic Save&Drive card for existing users;
- REGISTRATION VIA YOUR MOBILE PHONE for those who are not yet members of the Save&Drive program;
- INFORMATION ON THE CURRENT Save&Drive SPECIAL OFFERS available on filling stations;
- CONTACT FORM to the Contact Centre for any additional information;
- Fast and easy update and changes of user information in Save&Drive profile. 
As we seek to improve our application further through additional content, offers and services, we would like to thank you in advance for your constructive comments and suggestions.
More information about the Save&Drive  program of OMV in Bulgaria and the mobile application can be found on www.omv.bg/save-and-drive.

Aplikáce HandyLex od spoločnosti Lingea ponúka k stiahnutiu rôzne slovníky v vreckovom, alebo veľkom rozsahu hesiel.. Sú určené pre náročných študentov jazyka, učiteľov a prekladateľov.

Slovník obsahuje:
• anglicko-slovenský vreckový slovník
• automatické rozpoznávanie jazyka, takže nie je nutné prepínať „smer“ prekladu;
• ponuku preklepov pri zadávaní slov a našepkávač, vďaka ktorému nie je potrebné písať celé slová;
• tabuľky tvaroslovia (veľké slovníky);
• možnosť overiť si správnosť prekladu pre každé heslové slovo – stačí klepnúť na akýkoľvek zobrazený preklad a ten sa ihneď vyhľadá ako samostatné heslo aj vo fulltextovom vyhľadávaní;
• tvaroslovné vyhľadávanie;
• výslovnosť nahovorená rodeným hovoriacim vo vysokej audio kvalite pre väčšinu heslových slov v cudzom jazyku (veľké slovníky);
• fonetické prepisy heslových slov;
• možnosť zaradenia hesiel medzi „obľúbené“;
• podpora funkcie Split View;
• automatický preklad slov pri kopírovaní textu do schránky;
• klávesové skratky (iba pre hardvérové klávesnice).

Všetky vyššie uvedené funkcie robia zo slovníka ideálneho pomocníka pre každodenné použitie v práci, v škole, doma alebo na dovolenke. 

Prehľadné a starostlivo štruktúrované heslá spolu s kontextovými poznámkami pri ekvivalentoch v každom význame vám uľahčia používanie slovníka, pomôžu vám vybrať ten správny preklad a vyhnúť sa tak nedorozumeniam. 

Lingea s.r.o. je poprednou spoločnosťou vo vývoji elektronických a knižných slovníkov. Máme viac ako dvadsaťročnú skúsenosť v oblasti lingvistiky získanú pri vyvíjaní vlastných dát a jazykového softvéru. Neustále a s najvyššou starostlivosťou sa snažíme udržiavať naše slovníky aktuálne a zachytiť tak skutočný obraz súčasného jazyka.
